pragma solidity ^0.5.6;

import "../contracts/Country.sol";
import "../contracts/PersonLib.sol";
import "../contracts/Organization.sol";

contract IndiaId is Country{
    using Counters for Counters.Counter;

    PersonLib public pLib;
    Organization public iniOrgAddr;

    constructor(Organization _orgAddr) public{
        iniOrgAddr = _orgAddr;
        pLib = new PersonLib();
        iniOrgAddr.registerCountry(this, owner(), "India");
    }
    function addPersonFromAuction(
        uint256 uTokenId,
        uint256 _value,
        bytes8 _name,
        bytes8 _originCountry) public returns(uint256){
            pLib.addPerson(uTokenId, _name, _value, _originCountry, "India", this, owner());
        }
    function addPerson(
        bytes8 _name,
        bytes8 _originCountry
    )  public onlyOwner returns(uint256){
        uint256 uTokenId = iniOrgAddr.createToken(this, owner(), "India");
        uint tokenId = pLib.addPerson(uTokenId, _name, 10000, _originCountry, "India", this, owner());
        return tokenId;
    }

    function getPopulation() public view returns(uint256){
        return pLib.getPopulation();
    }
    //There is a bug here.
    //Because if this is not included as a default impl in the Country contract, people can change the state of auction
    //which will not enable the people to transfer the asset.
    function getIntoAuction(uint256 tokenId) public onlyOwner{
        //First check if this token is already in auction
        pLib.setForAuction(pLib.getUTokenID(tokenId));
        iniOrgAddr.getIntoAuction(pLib.getUTokenID(tokenId), owner(), "India");
    }
    function getDetails(uint256 tokenId, uint256 value) public returns(bytes8, bytes8){
        pLib.resetStatus(tokenId);
        pLib.setPresentCountry(tokenId, "");
        pLib.setValue(tokenId, value);

        return (pLib.getDetails(tokenId));
    }
    function endAuction(uint256 tokenId) public{
        uint256 uTI = pLib.getUTokenID(tokenId);
        iniOrgAddr.endAuction(uTI, tokenId, owner(), "India");
    }
}
